      .root-container {box-sizing:content-box;position:relative;background:#fff;min-width:1000px;max-width:1400px; max-height:100vh;min-height:700px;overflow:hidden;transition:filter .3s;display:flex;flex-grow:1;}

      .app-loaded > .root-container > .root-loading {display: none}

      .retry .retry-btn {display: block}
